Object.Field:
BEGIN

begin
  DBMS_ERRLOG.create_error_log ('<?=snpRef.getObjectName("L", "EVENTS", "DWH", "", "D") ?>','<@=gTab@>','<@=lSchema@>', skip_unsupported=>true);
exception 
  when others then null;
end;

for rec in ( select * from  all_tab_columns
            where owner = 'DWH'
            and DATA_TYPE = 'DATE'
            and TABLE_NAME = '<?=snpRef.getObjectName("L", "EVENTS", "DWH", "", "D") ?>') loop
begin
    execute immediate 'alter table <@=lSchema@>.<@=gTab@> MODIFY ('||rec.COLUMN_NAME||' DATE)';
exception when others 
    then null;    
end;

end loop;

END;

begin
    dbms_stats.gather_table_stats(
	ownname => '<?=snpRef.getInfo("DEST_SCHEMA") ?>',
	tabname => '<?=snpRef.getObjectName("L", "EVENTS", "DWH", "", "D").replaceAll( "("+(char)92+"Q" + odiRef.getInfo( "DEST_SCHEMA" )+ (char)92+"E|" + (char)92 + "Q" + odiRef.getInfo( "DEST_WORK_SCHEMA" )+ (char)92 + "E).","")?>',
	estimate_percent => dbms_stats.auto_sample_size
    );
end;

declare
  p_sess_no number := <?=snpRef.getSession("SESS_NO") ?>;
  p_scen_name varchar2(1000 char) := '<?=snpRef.getSession("SCEN_NAME") ?>';
  p_sess_name varchar2(1000 char) := '<?=snpRef.getSession("SESS_NAME") ?>';
  p_owner varchar2(30 char) := '<?=snpRef.getInfo("DEST_SCHEMA") ?>';
  p_table_name varchar2(30 char) := 'EVENTS';
  p_err_flg varchar2(30);
begin
select case when  count(*) > 0 then  '_ERR' else '' end 
into  p_err_flg
from <@=lSchema@>.<@=gTab@> 
where PROCESS_KEY = p_sess_no 
and file_id in (select  distinct file_id from <?=snpRef.getSchemaName("STG_XML_CRM", "D") ?>.<?=snpRef.getObjectShortName("L", "V_CRM_EVENTS", "STG_XML_CRM", "D") ?>);
for x in (
select distinct file_id
from <?=snpRef.getSchemaName("STG_XML_CRM", "D") ?>.<?=snpRef.getObjectShortName("L", "V_CRM_EVENTS", "STG_XML_CRM", "D") ?> 
where file_id is not null 
)
loop
  insert into ETL.CTL_INPUT_FILES_LOG values(x.file_id, decode(length(p_err_flg), null, 1, -1)*3 ,sysdate);
  update ETL.CTL_INPUT_FILES_LOADING set status_cd=p_owner||p_err_flg, load_dt=sysdate where file_id=x.file_id;
end loop;
end;
